import jsPDF from 'jspdf';

const montserratFont = function () {
    var font = '';
    const callAddFont = function () {
        this.addFileToVFS('montserrat.ttf', font);
        this.addFont('montserrat.ttf', 'montserrat', 'extrabold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont]);
};

export default montserratFont;